const getCourseAdministraionByCourse =
  (id: string) => async (dispatch: AppDispatch) => {
    return AdministrationRoute.getCourseAdministraionByCourse(id)
      .then((res: AxiosResponse) => {
        if (res?.data) {
          dispatch(handleGetCourseAdministration(res?.data?.records));
        }
      })
      .catch((err: AxiosError) => {});
  };

const getStudentAndAdministrationByAssessmentId = (
  id: any,
  //cancelToken: any,
  gridRef: any,
  callback: any,
  setLoading: any
) => {
  if (cancelGetStudentsByCourse) {
    cancelGetStudentsByCourse.cancel('Operation canceled by the user.');
  }

  cancelGetStudentsByCourse = axios.CancelToken.source();
  return AdministrationRoute.getStudentAndAdministrationByAssessment(
    id,
    cancelGetStudentsByCourse.token
  )
    .then((result: AxiosResponse) => {
      setLoading(false);
      callback(result);
    })
    .catch((err: AxiosError) => {
      gridRef?.current?.api.setRowData([]);
    })
    .finally(() => {
      if (gridRef?.current) gridRef.current.api.hideOverlay();
    });
};

