const updateTime = (
  data: any,
  sendMail: any,
  arr: any,
  bool: any,
  set: any,
  ind: any
) => {
  return AdministrationRoute.changeStartTime(data)
    .then((result: AxiosResponse) => {
      if (result.data) {
        if (moment.utc(data.start_date_time).isBefore(moment.utc())) {
          sendMail(arr, bool, set, ind);
        } else {
          Alert.success({ title: 'Dates saved successfully', text: '' });
        }
      }
    })
    .catch((error: AxiosError) => {});
};

const getResultAnalysis = (
  courseAssessmentId: string,
  downloadReportAnalysis: any
) => {
  return AdministrationRoute.getResultAnalysis(courseAssessmentId)
    .then((result: AxiosResponse) => {
      if (result.data) {
        downloadReportAnalysis(
          result.data.courseInfoData,
          result.data.studentResultsData
        );
      }
    })
    .catch((error: AxiosError) => {});
};

const getResultAnalysisAdm = (
  courseAssessmentId: string,
  administration_id: string,
  downloadReportAnalysis: any
) => {
  return AdministrationRoute.getResultAnalysisAdm(
    courseAssessmentId,
    administration_id
  )
    .then((result: AxiosResponse) => {
      if (result.data) {
        downloadReportAnalysis(
          result.data.courseInfoData,
          result.data.studentResultsData
        );
      }
    })
    .catch((error: AxiosError) => {});
};

const AdministrationSlice = createSlice({
  name: 'AdministrationSlice',
  initialState,
  reducers: {
    handleGetCourseAdministration: (state, action) => {
      state.getCourseAdministration = action.payload;
    },
    handleLoading: (state, action) => {
      state.loading = action.payload;
    },
  },
});

//reducers export  to pass action state to reducer type
export const { handleLoading, handleGetCourseAdministration } =
  AdministrationSlice.actions;

